import React from "react";
import { Router, Switch, Route } from "react-router";
import "./App.css";
import Search from "./components/search";
import Add from "./components/add";

function App() {
    return (
        <div id="app">
            <Router>
                <Switch>
                    <Route path="/" exact>
                        <Search></Search>
                    </Route>
                    <Route path="/add">
                        <Add></Add>
                    </Route>
                </Switch>
            </Router>
            <Search></Search>
        </div>
    );
}

export default App;
